import Fetch from 'isomorphic-unfetch';
import Layout from '../components/Layout.js'

const Index = (props) => (
    <Layout>
        <div>
            <h1>Welcome to CAN SLIM Investing System</h1>
            <h2>Where we do the work for you!</h2>
            console.log(props)
            {props.incomeStatement}
        </div>
    </Layout>
);

Index.getInitialprops = async function () {
    const res = await fetch('https://finnhub.io/api/v1/stock/ownership?symbol=AAPL&limit=20&token=bt2m8u748v6sj2tj1bm0');
    const data = await res.json();

    return {
        incomeStatement: data
    }
}

export default Index;
